import React from 'react'
import Home from './components/Home.js'
import {faCog, faMap, faUser, faVideo} from '@fortawesome/free-solid-svg-icons'
import MenuItem from './MenuItem.js'

const menuStyle = {
    background: '#ed217c',
    paddingLeft: '5%'
}

function App() {
  return (
          <div className = 'App'>
              <div className = 'MainMenu' display='block' style={menuStyle}>
                    <MenuItem name = 'Identifícate' icon = {faUser} ></MenuItem>
                    <MenuItem name='Mapa' icon={faMap}></MenuItem>
                    <MenuItem name='Publicidad' icon={faVideo}></MenuItem>
                    <MenuItem name = 'Configuración' icon = {faCog}></MenuItem>
              </div> 
            <Home></Home>
          </div>
        );
}

export default App;
